q= out.q;qd= out.qd;t = out.t;plot3(q(:,1),q(:,2),q(:,3));hold onplot3(qd(:,1),qd(:,2),qd(:,3));legend('Response Path','Expected Path');xlabel('X(m)');ylabel('Y(m)');zlabel('Z(m)');grid on;figure;grid off;subplot(3,1,1);plot(t,q(:,1)-qd(:,1));subplot(3,1,2);plot(t,q(:,2)-qd(:,2));subplot(3,1,3);plot(t,q(:,3)-qd(:,3));clear("t")clear("q")clear("qd")